// import './App.css';
import React from 'react';
import HomePage from './pages/HomePage';
import { Routes ,Route} from 'react-router-dom';

function App() {
  return (

    <div >
         <BrowserRouter >
         </BrowserRouter>
      <Routes>
        <Route path="/" element={<HomePage />} />
      </Routes>
    </div >
  );
}

export default App;
